    <input type="text" class="form-control" id='6' />
    <label htmlFor='#7'>Visit During</label>
    <input type="text" class="form-control" id='7' />

  </div>
  <button type="submit" class="btn btn-primary">Submit</button>
</form>
</Fragment>
